import React, { Component} from "react";
import data from "./data";
import axios from 'axios';

class TeamTwo extends Component {
    constructor(props) {
        super(props)
        this.state = {
           
            teams: [],
            

        
        };
        
    }
   
    componentDidMount() {
       
        this.TeamsList()
       
      }
      TeamsList(){
        axios.get('http://localhost:8000/api/teams/').then(res => res.data)
        .then(res => {
            this.setState({
                teams: res.data
            });
            
          })
          .catch((error) => {
            console.log(error);
          })
    }
    render() {
    return (
        <div className="row">
            {this.state.teams.map(team => 
                <div className={`${team.column}`} key={team.id}>
                    <div className={`team ${team.teamStyle}`}>
                        <div className="thumbnail">
                            <img src={`http://localhost:8000/images/Team/${team.team_image}`} alt="Blog Images"/>
                        </div>
                        <div className="inner">
                            <div className="content">
                                <h4 className="title">{team.title}</h4>
                                <p className="designation">{team.designation}</p>
                            </div> 
                            <div>
                           <p> {team.title}
                           
                           </p>
                             <p>{team.designation}</p> 
</div>
                            <ul className="social-transparent liststyle d-flex" >
                                {team.socials.map(soc =>
                                    <li key={soc.id}><a href={`${soc.url}`}>{soc.icon}</a></li>
                                )}
                            </ul>
                        </div>
                    </div>
                </div>
            )}
        </div>
    )
                                }
}

export default TeamTwo
